// 获取竞赛
//获取竞赛
export const COMPETITION = '/v1/global/getBattle';
export enum CompetitionTyp{
  INPROGRESS = '1',
  END = '3',
}

export interface battleItem{
  name: string,
  image: string,
  countType: number,
  gameIds: string,
  currencyId: number,
  rule:string,
  reward: number,
  peroid: number
}

export interface ranksDataItem{
  name: string,
  avatar: string,
  level: number,
  score: number,
  ranking: null,
  reward: number,
  currencyId: number,
  userId: number
}

export interface ranksItem{
  pages: number,
  total: number,
  pageNum: number,
  data: ranksDataItem[],
}

export interface CompetitionResp {
  id: number,
  battleId: number,
  startTime: string,
  round: string,
  endTime: string,
  status: number,
  battle:battleItem,
  index:[],
  rate:[],
  ranks:ranksItem,
}

export const GETGAMEBY = '/v1/global/getGameById';
export interface GameByReq {
  gameIds: number[];
  pageSize:number;
  pageNum:number;
}
export interface GameItem{
  id: number;
  name: string;
  categoryId: number;
  groupId: number;
  icon: string;
  image: string;
  description: string;
  provider: string;
  prizePool: number;
  fullScreen: number;
  statistic: number;
  sign: number;
  minCurrency: number;
  maxCurrency: number;
  gameUrl: string;
  cmd:string;
}
export interface GameByResp {
  pages: number,
  total: number,
  pageNum: number,
  data:GameItem[],
}
/**竞赛json */
export interface BattleInfo {
  batitle: string;
  baStart: string;
  baType: {
    baTypeTitle: string;
    profitTitle: string;
    profitText: string;
  };
  baRank: {
    rankTitle: string;
    rankText: string;
  };
  baCurrency: {
    currencyTitle: string;
    currencyFun: string;
  };
}
